export const requestDate = (props) => {
    return dispatch => {
        fetch(`http://localhost:3000/appointments/${this.props.id}`, {
            method: "PATCH",
            headers: {
                'Content-Type': 'application/json',
                "Accept": "application/json"
            },
            body: JSON.stringify(
                {
                    params: {
                        user_id: this.props.current_user.id,
                        appointment_id: this.props.id
                    }
                }
            )
        })
            .then(response => response.json())
            .then(json=> {   
            })
    };
}
